                this.dataServer.classesObj.rayHitModelList.RemoveRayHitModel(this.wallMeshs[key]);
                this.dataServer.sceneCommonObj.scene.remove(this.wallMeshs[key]);
                this.wallMeshs[key].material.dispose();
